import React from 'react';
import { useNavigate,Link } from 'react-router-dom';
import { useSession } from '../session'; // Import du hook useSession

function Navbar() {
  const { isLoggedIn, logout } = useSession(); // Utilisation du hook useSession
  const navigate = useNavigate();

  const handleLogout = async () => {
    logout();
    localStorage.removeItem('jwt');
    navigate("/");
  };

  return (
    <nav className="bg-white text-black p-4 flex justify-between items-center fixed top-0 w-full">
      <div>
        <Link to="#" className="text-xl font-bold">Mon Application</Link>
      </div>
      <div className="flex items-center">
        <Link to="/" className="mr-4">Home</Link>
        {!isLoggedIn && (
          <Link to="/login" className="mr-4">Login</Link>
        )}
        {!isLoggedIn && (
          <Link to="/register" className="mr-4">Register</Link>
        )}
        {isLoggedIn && (
          <button className="mr-4 flex items-center text-white" onClick={handleLogout}>
            <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-1" viewBox="0 0 20 20" fill="currentColor">
              <path fillRule="evenodd" d="M10 2a8 8 0 100 16 8 8 0 000-16zm1.5 11a.5.5 0 01-.5.5h-7a.5.5 0 01-.5-.5v-1a.5.5 0 01.5-.5h7a.5.5 0 01.5.5v1zm-5-4a.5.5 0 00-.5.5v1a.5.5 0 00.5.5h7a.5.5 0 00.5-.5v-1a.5.5 0 00-.5-.5h-7z" clipRule="evenodd" />
            </svg>
            DÃ©connexion
          </button>
        )}
        {isLoggedIn && (
          <Link to="/wilaya" className="mr-4">Wilaya</Link>
        )}
        {isLoggedIn && (
          <Link to="/profile">Profil</Link>
        )}
      </div>
    </nav>
  );
}

export default Navbar;
